    results = []
    for i in range(T):
        N = len(test_cases[i])
        players = test_cases[i]
        points = [0] * N
        for j in range(N):
            curr = players[j]
            for k in range(j + 1, N):
                (score1, score2) = (0, 0)
                for l in range(5):
                    if curr[l] == players[k][l]:
                        continue
                    if beats(curr[l], players[k][l]):
                        score1 += 1
                    else:
                        score2 += 1
                if score1 == score2:
                    points[j] += 0.5
                    points[k] += 0.5
                elif score1 > score2:
                    points[j] += 1
                else:
                    points[k] += 1
        results.append(points.index(max(points)))
    return results

